{
  "components": {
    "responses": {
      "Error": {
        "content": {
          "application/json": {
            "schema": {
              "$ref": "#/components/schemas/Error"
            }
          }
        },
        "description": "Error"
      }
    },
    "schemas": {
      "AccountProvider": {
        "description": "An account provider.",
        "enum": [
          "google",
          "github"
        ],
        "type": "string"
      },
      "ApiCallQueryGroup": {
        "description": "A response for a query on the API call table that is grouped by something.",
        "properties": {
          "count": {
            "format": "int64",
            "type": "integer"
          },
          "query": {
            "type": "string"
          }
        },
        "required": [
          "count",
          "query"
        ],
        "type": "object"
      },
      "ApiCallQueryGroupBy": {
        "description": "The field of an API call to group by.",
        "enum": [
          "email",
          "method",
          "endpoint",
          "user_id",
          "origin",
          "ip_address"
        ],
        "type": "string"
      },
      "ApiCallStatus": {
        "description": "The status of an async API call.",
        "enum": [
          "Queued",
          "Uploaded",
          "In Progress",
          "Completed",
          "Failed"
        ],
        "type": "string"
      },
      "ApiCallWithPrice": {
        "description": "An API call with the price.\n\nThis is a join of the `ApiCall` and `ApiCallPrice` tables.",
        "properties": {
          "completed_at": {
            "description": "The date and time the API call completed billing.",
            "format": "date-time",
            "nullable": true,
            "title": "DateTime",
            "type": "string"
          },
          "created_at": {
            "description": "The date and time the API call was created.",
            "format": "date-time",
            "title": "DateTime",
            "type": "string"
          },
          "duration": {
            "description": "The duration of the API call.",
            "format": "duration",
            "nullable": true,
            "title": "int64",
            "type": "integer"
          },
          "email": {
            "description": "The user's email address.",
            "format": "email",
            "type": "string"
          },
          "endpoint": {
            "description": "The endpoint requested by the API call.",
            "type": "string"
          },
          "id": {
            "allOf": [
              {
                "$ref": "#/components/schemas/Uuid"
              }
            ],
            "description": "The unique identifier for the API call."
          },
          "ip_address": {
            "default": "",
            "description": "The ip address of the origin.",
            "format": "ip",
            "title": "String",
            "type": "string"
          },
          "litterbox": {
            "description": "If the API call was spawned from the litterbox or not.",
            "nullable": true,
            "type": "boolean"
          },
          "method": {
            "allOf": [
              {
                "$ref": "#/components/schemas/Method"
              }
            ],
            "description": "The HTTP method requsted by the API call."
          },
          "minutes": {
            "description": "The number of minutes the API call was billed for.",
            "format": "int32",
            "nullable": true,
            "type": "integer"
          },
          "origin": {
            "description": "The origin of the API call.",
            "type": "string"
          },
          "price": {
            "description": "The price of the API call.",
            "format": "money-usd",
            "nullable": true,
            "title": "Number",
            "type": "number"
          },
          "request_body": {
            "description": "The request body sent by the API call.",
            "nullable": true,
            "type": "string"
          },
          "request_query_params": {
            "description": "The request query params sent by the API call.",
            "type": "string"
          },
          "response_body": {
            "description": "The response body returned by the API call. We do not store this information if it is above a certain size.",
            "nullable": true,
            "type": "string"
          },
          "started_at": {
            "description": "The date and time the API call started billing.",
            "format": "date-time",
            "nullable": true,
            "title": "DateTime",
            "type": "string"
          },
          "status_code": {
            "description": "The status code returned by the API call.",
            "format": "int32",
            "nullable": true,
            "title": "int32",
            "type": "integer"
          },
          "stripe_invoice_item_id": {
            "description": "The Stripe invoice item ID of the API call if it is billable.",
            "type": "string"
          },
          "token": {
            "allOf": [
              {
                "$ref": "#/components/schemas/Uuid"
              }
            ],
            "description": "The API token that made the API call."
          },
          "updated_at": {
            "description": "The date and time the API call was last updated.",
            "format": "date-time",
            "title": "DateTime",
            "type": "string"
          },
          "user_agent": {
            "description": "The user agent of the request.",
            "type": "string"
          },
          "user_id": {
            "description": "The ID of the user that made the API call.",
            "type": "string"
          }
        },
        "required": [
          "created_at",
          "id",
          "method",
          "token",
          "updated_at",
          "user_agent"
        ],
        "type": "object"
      },
      "ApiCallWithPriceResultsPage": {
        "description": "A single page of results",
        "properties": {
          "items": {
            "description": "list of items on this page of results",
            "items": {
              "$ref": "#/components/schemas/ApiCallWithPrice"
            },
            "type": "array"
          },
          "next_page": {
            "description": "token used to fetch the next page of results (if any)",
            "nullable": true,
            "type": "string"
          }
        },
        "required": [
          "items"
        ],
        "type": "object"
      },
      "ApiToken": {
        "description": "An API token.\n\nThese are used to authenticate users with Bearer authentication.",
        "properties": {
          "created_at": {
            "description": "The date and time the API token was created.",
            "format": "date-time",
            "title": "DateTime",
            "type": "string"
          },
          "id": {
            "description": "The unique identifier for the API token.",
            "type": "string"
          },
          "is_valid": {
            "description": "If the token is valid. We never delete API tokens, but we can mark them as invalid. We save them for ever to preserve the history of the API token.",
            "type": "boolean"
          },
          "token": {
            "allOf": [
              {
                "$ref": "#/components/schemas/Uuid"
              }
            ],
            "description": "The API token itself."
          },
          "updated_at": {
            "description": "The date and time the API token was last updated.",
            "format": "date-time",
            "title": "DateTime",
            "type": "string"
          },
          "user_id": {
            "description": "The ID of the user that owns the API token.",
            "type": "string"
          }
        },
        "required": [
          "created_at",
          "is_valid",
          "token",
          "updated_at"
        ],
        "type": "object"
      },
      "ApiTokenResultsPage": {
        "description": "A single page of results",
        "properties": {
          "items": {
            "description": "list of items on this page of results",
            "items": {
              "$ref": "#/components/schemas/ApiToken"
            },
            "type": "array"
          },
          "next_page": {
            "description": "token used to fetch the next page of results (if any)",
            "nullable": true,
            "type": "string"
          }
        },
        "required": [
          "items"
        ],
        "type": "object"
      },
      "AppClientInfo": {
        "description": "Information about a third party app client.",
        "properties": {
          "url": {
            "description": "The URL for consent.",
            "type": "string"
          }
        },
        "type": "object"
      },
      "AsyncApiCall": {
        "description": "An async API call.",
        "properties": {
          "completed_at": {
            "description": "The time and date the async API call was completed.",
            "format": "date-time",
            "nullable": true,
            "title": "DateTime",
            "type": "string"
          },
          "created_at": {
            "description": "The time and date the async API call was created.",
            "format": "date-time",
            "title": "DateTime",
            "type": "string"
          },
          "error": {
            "description": "The error the function returned, if any.",
            "nullable": true,
            "type": "string"
          },
          "id": {
            "allOf": [
              {
                "$ref": "#/components/schemas/Uuid"
              }
            ],
            "description": "The unique identifier of the async API call.\n\nThis is the same as the API call ID."
          },
          "input": {
            "default": null,
            "description": "The JSON input for the API call. These are determined by the endpoint that is run."
          },
          "output": {
            "description": "The JSON output for the API call. These are determined by the endpoint that is run.",
            "nullable": true
          },
          "started_at": {
            "description": "The time and date the async API call was started.",
            "format": "date-time",
            "nullable": true,
            "title": "DateTime",
            "type": "string"
          },
          "status": {
            "allOf": [
              {
                "$ref": "#/components/schemas/ApiCallStatus"
              }
            ],
            "description": "The status of the async API call."
          },
          "type": {
            "allOf": [
              {
                "$ref": "#/components/schemas/AsyncApiCallType"
              }
            ],
            "description": "The type of async API call."
          },
          "updated_at": {
            "description": "The time and date the async API call was last updated.",
            "format": "date-time",
            "title": "DateTime",
            "type": "string"
          },
          "user_id": {
            "description": "The user ID of the user who created the async API call.",
            "type": "string"
          },
          "worker": {
            "description": "The worker node that is performing or performed the async API call.",
            "type": "string"
          }
        },
        "required": [
          "created_at",
          "id",
          "status",
          "type",
          "updated_at"
        ],
        "type": "object"
      },
      "AsyncApiCallOutput": {
        "description": "The output from the async API call.",
        "oneOf": [
          {
            "description": "A file conversion.",
            "properties": {
              "completed_at": {
                "description": "The time and date the file conversion was completed.",
                "format": "date-time",
                "nullable": true,
                "title": "DateTime",
                "type": "string"
              },
              "created_at": {
                "description": "The time and date the file conversion was created.",
                "format": "date-time",
                "title": "DateTime",
                "type": "string"
              },
              "error": {
                "description": "The error the function returned, if any.",
                "nullable": true,
                "type": "string"
              },
              "id": {
                "allOf": [
                  {
                    "$ref": "#/components/schemas/Uuid"
                  }
                ],
                "description": "The unique identifier of the file conversion.\n\nThis is the same as the API call ID."
              },
              "output": {
                "description": "The converted file, if completed, base64 encoded.",
                "format": "byte",
                "nullable": true,
                "title": "String",
                "type": "string"
              },
              "output_format": {
                "allOf": [
                  {
                    "$ref": "#/components/schemas/FileOutputFormat"
                  }
                ],
                "description": "The output format of the file conversion."
              },
              "src_format": {
                "allOf": [
                  {
                    "$ref": "#/components/schemas/FileSourceFormat"
                  }
                ],
                "description": "The source format of the file conversion."
              },
              "started_at": {
                "description": "The time and date the file conversion was started.",
                "format": "date-time",
                "nullable": true,
                "title": "DateTime",
                "type": "string"
              },
              "status": {
                "allOf": [
                  {
                    "$ref": "#/components/schemas/ApiCallStatus"
                  }
                ],
                "description": "The status of the file conversion."
              },
              "type": {
                "enum": [
                  "FileConversion"
                ],
                "type": "string"
              },
              "updated_at": {
                "description": "The time and date the file conversion was last updated.",
                "format": "date-time",
                "title": "DateTime",
                "type": "string"
              },
              "user_id": {
                "description": "The user ID of the user who created the file conversion.",
                "type": "string"
              }
            },
            "required": [
              "created_at",
              "id",
              "output_format",
              "src_format",
              "status",
              "type",
              "updated_at"
            ],
            "type": "object"
          },
          {
            "description": "File center of mass.",
            "properties": {
              "center_of_mass": {
                "description": "The resulting center of mass.",
                "items": {
                  "format": "double",
                  "type": "number"
                },
                "nullable": true,
                "type": "array"
              },
              "completed_at": {
                "description": "The time and date the mass was completed.",
                "format": "date-time",
                "nullable": true,
                "title": "DateTime",
                "type": "string"
              },
              "created_at": {
                "description": "The time and date the mass was created.",
                "format": "date-time",
                "title": "DateTime",
                "type": "string"
              },
              "error": {
                "description": "The error the function returned, if any.",
                "nullable": true,
                "type": "string"
              },
              "id": {
                "allOf": [
                  {
                    "$ref": "#/components/schemas/Uuid"
                  }
                ],
                "description": "The unique identifier of the center of mass request.\n\nThis is the same as the API call ID."
              },
              "material_density": {
                "default": 0.0,
                "description": "The material density as denoted by the user.",
                "format": "float",
                "type": "number"
              },
              "src_format": {
                "allOf": [
                  {
                    "$ref": "#/components/schemas/FileSourceFormat"
                  }
                ],
                "description": "The source format of the file."
              },
              "started_at": {
                "description": "The time and date the mass was started.",
                "format": "date-time",
                "nullable": true,
                "title": "DateTime",
                "type": "string"
              },
              "status": {
                "allOf": [
                  {
                    "$ref": "#/components/schemas/ApiCallStatus"
                  }
                ],
                "description": "The status of the mass."
              },
              "type": {
                "enum": [
                  "FileCenterOfMass"
                ],
                "type": "string"
              },
              "updated_at": {
                "description": "The time and date the mass was last updated.",
                "format": "date-time",
                "title": "DateTime",
                "type": "string"
              },
              "user_id": {
                "description": "The user ID of the user who created the mass.",
                "type": "string"
              }
            },
            "required": [
              "created_at",
              "id",
              "src_format",
              "status",
              "type",
              "updated_at"
            ],
            "type": "object"
          },
          {
            "description": "A file mass.",
            "properties": {
              "completed_at": {
                "description": "The time and date the mass was completed.",
                "format": "date-time",
                "nullable": true,
                "title": "DateTime",
                "type": "string"
              },
              "created_at": {
                "description": "The time and date the mass was created.",
                "format": "date-time",
                "title": "DateTime",
                "type": "string"
              },
              "error": {
                "description": "The error the function returned, if any.",
                "nullable": true,
                "type": "string"
              },
              "id": {
                "allOf": [
                  {
                    "$ref": "#/components/schemas/Uuid"
                  }
                ],
                "description": "The unique identifier of the mass request.\n\nThis is the same as the API call ID."
              },
              "mass": {
                "description": "The resulting mass.",
                "format": "double",
                "nullable": true,
                "type": "number"
              },
              "material_density": {
                "default": 0.0,
                "description": "The material density as denoted by the user.",
                "format": "float",
                "type": "number"
              },
              "src_format": {
                "allOf": [
                  {
                    "$ref": "#/components/schemas/FileSourceFormat"
                  }
                ],
                "description": "The source format of the file."
              },
              "started_at": {
                "description": "The time and date the mass was started.",
                "format": "date-time",
                "nullable": true,
                "title": "DateTime",
                "type": "string"
              },
              "status": {
                "allOf": [
                  {
                    "$ref": "#/components/schemas/ApiCallStatus"
                  }
                ],
                "description": "The status of the mass."
              },
              "type": {
                "enum": [
                  "FileMass"
                ],
                "type": "string"
              },
              "updated_at": {
                "description": "The time and date the mass was last updated.",
                "format": "date-time",
                "title": "DateTime",
                "type": "string"
              },
              "user_id": {
                "description": "The user ID of the user who created the mass.",
                "type": "string"
              }
            },
            "required": [
              "created_at",
              "id",
              "src_format",
              "status",
              "type",
              "updated_at"
            ],
            "type": "object"
          },
          {
            "description": "A file volume.",
            "properties": {
              "completed_at": {
                "description": "The time and date the volume was completed.",
                "format": "date-time",
                "nullable": true,
                "title": "DateTime",
                "type": "string"
              },
              "created_at": {
                "description": "The time and date the volume was created.",
                "format": "date-time",
                "title": "DateTime",
                "type": "string"
              },
              "error": {
                "description": "The error the function returned, if any.",
                "nullable": true,
                "type": "string"
              },
              "id": {
                "allOf": [
                  {
                    "$ref": "#/components/schemas/Uuid"
                  }
                ],
                "description": "The unique identifier of the volume request.\n\nThis is the same as the API call ID."
              },
              "src_format": {
                "allOf": [
                  {
                    "$ref": "#/components/schemas/FileSourceFormat"
                  }
                ],
                "description": "The source format of the file."
              },
              "started_at": {
                "description": "The time and date the volume was started.",
                "format": "date-time",
                "nullable": true,
                "title": "DateTime",
                "type": "string"
              },
              "status": {
                "allOf": [
                  {
                    "$ref": "#/components/schemas/ApiCallStatus"
                  }
                ],
                "description": "The status of the volume."
              },
              "type": {
                "enum": [
                  "FileVolume"
                ],
                "type": "string"
              },
              "updated_at": {
                "description": "The time and date the volume was last updated.",
                "format": "date-time",
                "title": "DateTime",
                "type": "string"
              },
              "user_id": {
                "description": "The user ID of the user who created the volume.",
                "type": "string"
              },
              "volume": {
                "description": "The resulting volume.",
                "format": "double",
                "nullable": true,
                "type": "number"
              }
            },
            "required": [
              "created_at",
              "id",
              "src_format",
              "status",
              "type",
              "updated_at"
            ],
            "type": "object"
          },
          {
            "description": "A file density.",
            "properties": {
              "completed_at": {
                "description": "The time and date the density was completed.",
                "format": "date-time",
                "nullable": true,
                "title": "DateTime",
                "type": "string"
              },
              "created_at": {
                "description": "The time and date the density was created.",
                "format": "date-time",
                "title": "DateTime",
                "type": "string"
              },
              "density": {
                "description": "The resulting density.",
                "format": "double",
                "nullable": true,
                "type": "number"
              },
              "error": {
                "description": "The error the function returned, if any.",
                "nullable": true,
                "type": "string"
              },
              "id": {
                "allOf": [
                  {
                    "$ref": "#/components/schemas/Uuid"
                  }
                ],
                "description": "The unique identifier of the density request.\n\nThis is the same as the API call ID."
              },
              "material_mass": {
                "default": 0.0,
                "description": "The material mass as denoted by the user.",
                "format": "float",
                "type": "number"
              },
              "src_format": {
                "allOf": [
                  {
                    "$ref": "#/components/schemas/FileSourceFormat"
                  }
                ],
                "description": "The source format of the file."
              },
              "started_at": {
                "description": "The time and date the density was started.",
                "format": "date-time",
                "nullable": true,
                "title": "DateTime",
                "type": "string"
              },
              "status": {
                "allOf": [
                  {
                    "$ref": "#/components/schemas/ApiCallStatus"
                  }
                ],
                "description": "The status of the density."
              },
              "type": {
                "enum": [
                  "FileDensity"
                ],
                "type": "string"
              },
              "updated_at": {
                "description": "The time and date the density was last updated.",
                "format": "date-time",
                "title": "DateTime",
                "type": "string"
              },
              "user_id": {
                "description": "The user ID of the user who created the density.",
                "type": "string"
              }
            },
            "required": [
              "created_at",
              "id",
              "src_format",
              "status",
              "type",
              "updated_at"
            ],
            "type": "object"
          },
          {
            "description": "A file surface area.",
            "properties": {
              "completed_at": {
                "description": "The time and date the density was completed.",
                "format": "date-time",
                "nullable": true,
                "title": "DateTime",
                "type": "string"
              },
              "created_at": {
                "description": "The time and date the density was created.",
                "format": "date-time",
                "title": "DateTime",
                "type": "string"
              },
              "error": {
                "description": "The error the function returned, if any.",
                "nullable": true,
                "type": "string"
              },
              "id": {
                "allOf": [
                  {
                    "$ref": "#/components/schemas/Uuid"
                  }
                ],
                "description": "The unique identifier of the density request.\n\nThis is the same as the API call ID."
              },
              "src_format": {
                "allOf": [
                  {
                    "$ref": "#/components/schemas/FileSourceFormat"
                  }
                ],
                "description": "The source format of the file."
              },
              "started_at": {
                "description": "The time and date the density was started.",
                "format": "date-time",
                "nullable": true,
                "title": "DateTime",
                "type": "string"
              },
              "status": {
                "allOf": [
                  {
                    "$ref": "#/components/schemas/ApiCallStatus"
                  }
                ],
                "description": "The status of the density."
              },
              "surface_area": {
                "description": "The resulting surface area.",
                "format": "double",
                "nullable": true,
                "type": "number"
              },
              "type": {
                "enum": [
                  "FileSurfaceArea"
                ],
                "type": "string"
              },
              "updated_at": {
                "description": "The time and date the density was last updated.",
                "format": "date-time",
                "title": "DateTime",
                "type": "string"
              },
              "user_id": {
                "description": "The user ID of the user who created the density.",
                "type": "string"
              }
            },
            "required": [
              "created_at",
              "id",
              "src_format",
              "status",
              "type",
              "updated_at"
            ],
            "type": "object"
          }
        ]
      },
      "AsyncApiCallResultsPage": {
        "description": "A single page of results",
        "properties": {
          "items": {
            "description": "list of items on this page of results",
            "items": {
              "$ref": "#/components/schemas/AsyncApiCall"
            },
            "type": "array"
          },
          "next_page": {
            "description": "token used to fetch the next page of results (if any)",
            "nullable": true,
            "type": "string"
